def initial(flag):
        if flag==1:
        # ---------начальное параллельное состояние намагничивания---------
            theta_p = mt.pi / 2 - 0.01  # начальный сферический угол намагниченности
            phi_p = mt.pi / 2 - 0.01  # начальный азимутальный угол намагниченности
            voltage_p_ap = -0.3  # напряжение переключения из ѕ в јѕ состояние
        # %---------начальное антипараллельное состояние намагничивания---------
        elif flag==2:
            theta_p =  0.01  # начальный сферический угол намагниченности
            phi_p = mt.pi / 2   # начальный азимутальный угол намагниченности
            voltage_p_ap = -0.3  # напряжение переключения из ѕ в јѕ состояние

        theta0 = theta_p  # начальный сферический угол намагниченности theta0
        phi0 = phi_p  # начальный азимутальный угол намагниченности phi0
        voltage_mtj = voltage_p_ap  # напряжение на магнитном туннельном переходе
        return theta0, phi0, ha, voltage_mtj, delta_t, t_final
def main():
    class Example(QtGui.QWidget):

        def __init__(self):
            super(Example, self).__init__()
            self.initUI()
        def initUI(self):
            cb = QtGui.QCheckBox('In-plane magnetization', self)
            cb.move(40, 55)
            cb.stateChanged.connect(self.changeTitle0)
            cd = QtGui.QCheckBox('Out of plane magnetization', self)
            cd.move(40, 30 )
            cd.stateChanged.connect(self.changeTitle1)
            btn = QtGui.QPushButton('Accept', self)
            btn.resize(btn.sizeHint())
            btn.move(80, 100)
            btn.clicked.connect(self.start)
            self.figure=plt.figure(figsize=(15,5))
            self.canvas=FigureCanvas(self.figure)
            self.setGeometry(300, 300, 250, 150)
            self.setWindowTitle('SpinBox')
            self.show()

        flag=0
        def changeTitle0(self,state ):
            if state == QtCore.Qt.Checked:
                Example.flag=1
        def changeTitle1(self,state ):
            if state == QtCore.Qt.Checked:
                Example.flag=2
        def start(self):
            #plt.cla
            plt.figure()
            #ax=self.figure.add_subplot(111)
            flag= Example.flag
            theta0, phi0, ha, voltage_mtj, delta_t, t_final=initial(flag)
            table_data_c = mag_dynamics(theta0, phi0, ha, voltage_mtj, delta_t, t_final,flag)

            plt.plot(table_data_c.tdata,table_data_c.mdata[:,0],'r')
            plt.plot(table_data_c.tdata,table_data_c.mdata[:,1],'g')
            plt.plot(table_data_c.tdata,table_data_c.mdata[:,2],'b')
            fig=plt.figure()

            ay=fig.add_subplot(111, projection='3d')
            ay.plot(table_data_c.mx, table_data_c.my, table_data_c.mz)
#--------------------Рисуем сферу---------------------------------------------------------------------------------------
            u, v = np.mgrid[0:2*np.pi:20j, 0:np.pi:10j]
            x=np.cos(u)*np.sin(v)
            y=np.sin(u)*np.sin(v)
            z=np.cos(v)

            ay.plot_wireframe(x, y, z, color="gray")
            plt.grid
            plt.show()

    app = QtGui.QApplication(sys.argv)
    ex = Example()
    sys.exit(app.exec_())
def m_initial_points(theta_start,phi_start):
#M_INITIAL_POINTS функция задает массив начальных значений намагниченности
# свободного магнитного слоя

    mx = np.empty((1,1))
    my = np.empty((1,1))
    mz = np.empty((1,1))

    m_start = np.empty((3,1))

    mx = mt.sin(theta_start)*mt.cos(phi_start)
    my = mt.sin(theta_start)*mt.sin(phi_start)
    mz = mt.cos(theta_start)
    m_start[0,0] = mx
    m_start[1,0] = my
    m_start[2,0] = mz
    return m_start
