def mag_system(tau,m,ha,stt_ip_norm_coeff,stt_oop_norm_coeff,flag):
    #MAG_SYSTEM вписывает неравновесную систему магнитной динамики для поиска
    #траекторий m=[mx,my,mz] в зависимости от времени
    #----глобальные переменные---
    global alpha, hk_in,hk_out
    # задание начального массива для равновесной системы уравнений
    F=np.zeros((m.shape[0], 1))
    #------------расчёт неравновесной системы магнитной динамики--------------
    if flag==1:
        F[0]=alpha*(m[1]**2+m[2]**2)*(ha-stt_ip_norm_coeff*m[2])+(m[2]-alpha*m[0]*m[1])*(hk_in*m[1]+stt_oop_norm_coeff)-(m[1]+alpha*m[0]*m[2])*(-hk_out*m[2]+stt_ip_norm_coeff*m[0])
        F[1]=-(m[2]+alpha*m[0]*m[1])*(ha-stt_ip_norm_coeff*m[2])+alpha*(m[0]**2+m[2]**2)*(hk_in*m[1]+stt_oop_norm_coeff)+(m[0]-alpha*m[1]*m[2])*(-hk_out*m[2]+stt_ip_norm_coeff*m[0])
        F[2]=(m[1]-alpha*m[0]*m[2])*(ha-stt_ip_norm_coeff*m[2])-(m[0]+alpha*m[1]*m[2])*(hk_in*m[1]+stt_oop_norm_coeff)+alpha*(m[0]**2+m[1]**2)*(-hk_out*m[2]+stt_ip_norm_coeff*m[0])
    elif flag==2:
        F[0]=alpha*(m[1]**2+m[2]**2)*(stt_ip_norm_coeff*m[1])+(m[2]-alpha*m[0]*m[1])*(-stt_ip_norm_coeff*m[0])-(m[1]+alpha*m[0]*m[2])*(stt_oop_norm_coeff+ha+hk_out*m[2]-m[2])
        F[1]=-(m[2]+alpha*m[0]*m[1])*(stt_ip_norm_coeff*m[1])+alpha*(m[0]**2+m[2]**2)*(-stt_ip_norm_coeff*m[0])+(m[0]-alpha*m[1]*m[2])*(stt_oop_norm_coeff+ha+hk_out*m[2]-m[2])
        F[2]=(m[1]-alpha*m[0]*m[2])*(stt_ip_norm_coeff*m[1])-(m[0]+alpha*m[1]*m[2])*(-stt_ip_norm_coeff*m[0])+alpha*(m[0]**2+m[1]**2)*(stt_oop_norm_coeff+ha+hk_out*m[2]-m[2])
    return F
def mag_dynamics(theta_start,phi_start,ha,voltage_mtj,delta_t,t_final,flag):
#  MAG_DYNAMICS совершает проверку достоверности расчёта траекторий проекций намагниченности m=(mx,my,mz)
# и особых стационарных точекдл€ неравновесной системы уравнений магнитной динамики mag_system.m

#---глобальные переменные---
    global gamma0, alpha, mu0, Ms, df
#---задание интервала времени счёта задачи---%
    t0_int= np.arange(0,t_final,100*delta_t)
    tau0_norm=(gamma0*Ms)/(1+alpha**2) #% нормировочный коэффициент времени
    tau0_int=tau0_norm*t0_int
#---представление особой стационарной точки на сфере магнитной динамики---
    m_start=m_initial_points(theta_start,phi_start) # начальное положение единичной намагниченности
    stt_norm_coeff=(1/(mu0*(Ms**2)*df)) # нормировочный коэффициент для вращательного момента
    stt_ip_norm_coeff=stt_ip_norm(voltage_mtj)*stt_norm_coeff # параллельная компонента вращательного момента
    stt_oop_norm_coeff=stt_oop_norm(voltage_mtj)*stt_norm_coeff # перпендикулярная компонента вращательного момента
#----------численное решение динамики макроспина по методу –унге- утты-4 5 порядка----------------
    solver = ode(mag_system)
    solver.set_integrator('dopri5')
    solver.set_f_params(ha,stt_ip_norm_coeff,stt_oop_norm_coeff,flag)
    solver.set_initial_value(m_start, 0.0)#инициализация параметров

    mdatasolve = np.empty((len(t0_int),3))
    mdatasolve[0,0] = m_start[0,0]
    mdatasolve[0,1] = m_start[1,0]
    mdatasolve[0,2] = m_start[2,0]
    for k in range(1,tau0_int.shape[0]):
        solver.integrate(tau0_int[k])
        a=np.array(solver.y)
        mdatasolve[k,0]= a[0,0]
        mdatasolve[k,1]= a[1,0]
        mdatasolve[k,2]= a[2,0]
    class table_data:#  СОЗДАНИЕ КЛАССА ДЛЯ АТРИБУТОВ КЛАССА
        mx = mdatasolve[:,0]
        my = mdatasolve[:,1]
        mz = mdatasolve[:,2]
        # выходные данные по проекциям намагниченности
        mdata=mdatasolve
        tdata=tau0_int/tau0_norm # выходные данные по времени расчета
#---------------------------------------------Траектория намагниченности------------------------------------------------


    return table_data()

